INSERT INTO `field_data_field_user_description` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `field_user_description_value`, `field_user_description_format`) VALUES
('profile2', 'main', 0, 1, 1, 'und', 0, 'Dan has been working in the Madison real estate market since 1986.  A Madison native, he is also a graduate of the University of Wisconsin-Madison.\r\n\r\nIn 1994 he joined DSI Real Estate Group as Manager of Property Management Services responsible for the operations of the residential and commercial property management divisions.  This position continued to expand to include responsibilities in other areas, including development, leasing and brokerage, until in 1998 he was named Vice President.\r\n\r\nAs Vice President he oversees all operations of our business, spearheads all of our commercial development efforts and serves as our firms Designated Broker.  He is also active in the National Association of Realtors and has earned their designation as a Certified Real Estate Brokerage Manager. \r\n\r\nWith many years of experience covering the entire spectrum of commercial real estate, Dan is especially good at seeing the big picture.  From personnel to investment analysis to small business operations, Dan can lend a unique perspective to your project or property.', NULL);
